import api from "./api"

const BiciService = {

    getAllBici() {
        return api().get("/bici");
    },

    getOneBici(slug) {
        return api().get(`bici/${slug}`);
    },

    deleteBici(slug) {
        return api().delete(`bici/${slug}`);
    },

};

export default BiciService;
